import React from 'react';
import { Component } from 'react';
import style from './Prefeature.module.css'
import $ from "jquery"


class prefeature extends Component {

    componentDidMount(){
        $(document).ready(function(){

            activeItem = $("#accordion li:first");
            $(activeItem).addClass('active');

            $("#accordion li").hover(function(){
                $(activeItem).animate({width: "50px"}, {duration:300, queue:false});
                $(this).animate({width: "450px"}, {duration:300, queue:false});
                activeItem = this;
            });

        });
    }
    render(){
        const partner1 = require('../../Image/partnerImage/partner1.png')
        const partner2 = require('../../Image/partnerImage/partner2.png')
        return (
            <ul id="accordion">
                <li>
                    <img src={partner1} />
                    <strong>Section 1 Header</strong><br />
