                    <h5>Lorem ipsum dolor sit amet, consectetur adipiscing elit. In iaculis volutpat quam, non suscipit arcu accumsan at. Aliquam pellentesque.</h5>
                </li>
                <li>
                    <img src={partner1} />
                    <strong>Section 3 Header</strong><br />
                    <h5>Lorem ipsum dolor sit amet, consectetur adipiscing elit. In iaculis volutpat quam, non suscipit arcu accumsan at. Aliquam pellentesque.</h5>
                </li>
                <li>
                    <img src={partner2} />
                    <strong>Section 4 Header</strong><br />
                    <h5>Lorem ipsum dolor sit amet, consectetur adipiscing elit. In iaculis volutpat quam, non suscipit arcu accumsan at. Aliquam pellentesque.</h5>
